import React from 'react'
import { MdViewModule } from 'react-icons/md'

const NavUser = () => {
    return(
        <div>
            <MdViewModule style={user_icon}/>
        </div>
    );
}

const user_icon = {
    height: "6vh",
    width: "6vh",
    marginTop: "1vh",
    marginRight: "5vw"
}

export default NavUser
